// eslint-disable-next-line
import { UserLayout, BasicLayout, RouteView, BlankLayout, PageView } from '@/layouts'
import { bxAnaalyse } from '@/core/icons'

import { getMenu } from '@/api/manage'

export const asyncRouterMap = [
  {
    path: '/',
    name: 'index',
    component: BasicLayout,
    meta: { title: '首页' },
    redirect: '/dashboard/workplace',
    children: [
      // dashboard
      {
        path: '/dashboard',
        name: 'dashboard',
        redirect: '/dashboard/workplace',
        component: RouteView,
        meta: { title: '首页', keepAlive: true, icon: bxAnaalyse },
        children: [
          {
            path: '/dashboard/workplace',
            name: 'Workplace',
            component: () => import('@/views/dashboard/Workplace'),
            meta: { title: '欢迎使用', keepAlive: true }
          }
        ]
      },
      {
        path: '/test2',
        name: 'test2',
        redirect: '/dashboard/workplace',
        component: () => import('@/views/archives/test2'),
        meta: { title: '医疗', keepAlive: true, icon: bxAnaalyse }
      },
      // 问答库管理
      {
        path: '/ques',
        name: 'ques',
        component: RouteView,
        redirect: '/ques/Business',
        meta: { title: '问答库管理', icon: 'notification', permission: ['quesBusiness', 'quesChat', 'cmdCollection', 'fileManage', 'skillsType'] },
        children: [
          {
            path: '/ques/Business',
            name: 'quesBusiness',
            component: () => import('@/views/ques/Business'),
            meta: { title: '业务', permission: [ 'quesBusiness' ] }
          },
          {
            path: '/instruction/CmdCollection',
            name: 'CmdCollectionList',
            component: () => import('@/views/instruction/CmdCollection'),
            meta: { title: '动作集', permission: [ 'cmdCollection' ] }
          },
          {
            path: '/system/FileManage',
            name: 'FileManage',
            component: () => import('@/views/system/FileManage'),
            meta: { title: '文件管理', keepAlive: false, permission: [ 'fileManage' ] }
          }
        ]
      },

      // face人脸模块
      {
        path: '/face',
        name: 'face',
        component: RouteView,
        redirect: '/face/FaceList',
        meta: { title: '人脸管理', icon: 'smile', permission: [ 'face' ] },
        children: [
          {
            path: '/face/FaceList',
            name: 'faceList',
            component: () => import('@/views/face/FaceList'),
            meta: { title: '人脸库管理', permission: [ 'face' ] }
          }
        ]
      },
      // 户籍档案管理
      {
        path: '/archives',
        name: 'archives',
        component: RouteView,
        redirect: '/archives/ArchivesList',
        meta: { title: '户籍档案管理', icon: 'inbox', keepAlive: false, permission: ['archives'] },
        children: [
          {
            path: '/archives/ArchivesList',
            name: 'ArchivesList',
            component: () => import('@/views/archives/ArchivesList'),
            meta: { title: '户籍档案查询', permission: [ 'archives' ] }
          }
        ]
      }
    ]
  },

  {
    path: '*', redirect: '/404', hidden: true
  }
]

/**
 * 基础路由
 * @type { *[] }
 */
export const constantRouterMap = [
  {
    path: '/user',
    component: UserLayout,
    redirect: '/user/login',
    hidden: true,
    children: [
      {
        path: 'login',
        name: 'login',
        component: () => import(/* webpackChunkName: "user" */ '@/views/user/Login')
      },
      {
        path: 'register',
        name: 'register',
        component: () => import(/* webpackChunkName: "user" */ '@/views/user/Register')
      },
      {
        path: 'register-result',
        name: 'registerResult',
        component: () => import(/* webpackChunkName: "user" */ '@/views/user/RegisterResult')
      }
    ]
  },

  {
    path: '/test',
    component: BlankLayout,
    redirect: '/test/home',
    children: [
      {
        path: 'home',
        name: 'TestHome',
        component: () => import('@/views/Home')
      }
    ]
  },

  {
    path: '/404',
    component: () => import(/* webpackChunkName: "fail" */ '@/views/exception/404')
  }

]
